import React, { Fragment } from "react";
import { Link } from "react-router-dom";

export default function Leftbar() {
  const leftSidebarContent = [
    {
      title: "Questions",
      link: "/questions",
    },
    {
      title: "Tags",
      link: "/tags",
    },
    {
      title: "Users",
      link: "/users",
    },
    {
      title: "Companies",
      link: "/companies",
    },
  ];
  return (
    <React.Fragment>
      <div className="h-screen bg-stone-700 w-3/12 hidden sm:block">
        <p>Home</p>

        <div></div>
        <p className="relative top-16 text-left px-3 text-white uppercase text-xs">
          Public
        </p>
        <ul className="text-left relative top-16 w-full">
          {leftSidebarContent.map((item, index) => (
            <li
              key={index}
              className="w-full active:bg-gray-700 active:border-r-4 active:font-bold border-cyan-600 py-1 px-4"
            >
              <Link className="text-sm text-white" to={item.link}>
                {item.title}
              </Link>
            </li>
          ))}
        </ul>
      </div>
    </React.Fragment>
  );
}
